import {createRoot} from "react-dom";
import React from "react";

class Myfun extends React.Component{
  constructor(){
    super();

    this.state = {
      a:2,
      b:3
    }
  }

  swap = ()=>{
    var temp = this.state.a;
    this.state.a = this.state.b;
    this.state.b = temp;

    this.setState({a:this.state.a,b:this.state.b});
  }
  render(){
    return(<>
    <h1> a :{this.state.a} b: {this.state.b}</h1>
    <button onClick={this.swap}>Swap</button>
    </>);
  }
}

createRoot(document.getElementById("demo")).render(<Myfun/>);
